import React from 'react';
import 'bootswatch/dist/slate/bootstrap.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Container from 'react-bootstrap/Container';
import { FaShoppingCart } from 'react-icons/fa';
import IconePharmanet from '../img/logo-pharmanet.svg';

function CustomNavbar(props) {
    return (
        <Navbar bg="primary" variant="dark" expand="lg" fixed="top">
            <Container>
                {/* Logo e Nome da Marca */}
                <Navbar.Brand href="/">
                    <img
                        src={IconePharmanet}
                        width="28"
                        height="28"
                        className="d-inline-block align-middle"
                        alt="Logo PharmaNET"
                    />
                    PharmaNET
                </Navbar.Brand>

                {/* Botão do Menu Hamburguer */}
                <Navbar.Toggle aria-controls="navbarResponsive" />

                {/* Itens da Navbar */}
                <Navbar.Collapse id="navbarResponsive">
                    <Nav className="me-auto">
                        <Nav.Link href="/listagem-permissoes">Permissões</Nav.Link>
                        <Nav.Link href="/listagem-cargos">Cargos</Nav.Link>
                        <Nav.Link href="/listagem-farmacias">Farmácias</Nav.Link>
                        <Nav.Link href="/listagem-funcionarios">Funcionários</Nav.Link>
                        <Nav.Link href="/listagem-fornecedores">Fornecedores</Nav.Link>
                        <Nav.Link href="/listagem-estoques">Estoques</Nav.Link>
                        <Nav.Link href="/listagem-categorias">Categorias</Nav.Link>
                        <Nav.Link href="/listagem-produtos">Produtos</Nav.Link>
                        <Nav.Link href="/listagem-pedidos">Pedidos</Nav.Link>
                        <Nav.Link href="/listagem-vendas">Vendas</Nav.Link>
                        <Nav.Link href="/listagem-clientes">Clientes</Nav.Link>
                    </Nav>

                    {/* Ícone do Carrinho e Dropdown do Usuário */}
                    <Nav>
                        <Nav.Link href="/carrinho" className="me-3">
                            <FaShoppingCart size={20} />
                        </Nav.Link>

                        <NavDropdown title="Usuário" id="dropdown-user">
                            <NavDropdown.Item href="/login">Entrar</NavDropdown.Item>
                            <NavDropdown.Item href="/">Sair</NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default CustomNavbar;
